import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './pages/Login'; // Your Login page component
import './App.css';


function Home() {
  return (
    <div className="container">
      <h1>Welcome to CampusOrbit</h1>
      <p>An all-in-one student engagement system.</p>
      <div style={{ marginTop: "1rem" }}>
        <Link to="/login">
          <button>Go to Login</button>
        </Link>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        {/* Home page route */}
        <Route path="/" element={<Home />} />

        {/* Login page route */}
        <Route path="/login" element={<Login />} />

        {/* You can add more routes here later, e.g., Register, Dashboard */}
      </Routes>
    </Router>
  );
}

export default App;
